import React from 'react';

const Jumbotronhome = () => {
    return (
        <div>
            <div class="jumbotron jumbotron-fluid">
                <div class="container">
                    <h1 class="display-4">QuickUps</h1>
                    <p>Quickup's headline goes here</p>
                </div>
            </div>
        </div>
    )
}
export default Jumbotronhome;
